class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function maxFrequencyElements($nums) {
        // Count the frequency of each element
        $frequency = array_count_values($nums);

        // Find the maximum frequency
        $maxFrequency = max($frequency);

        // Count elements that have maximum frequency
        $countMaxFrequency = 0;
        foreach ($frequency as $freq) {
            if ($freq == $maxFrequency) {
                $countMaxFrequency += $freq;
            }
        }

        return $countMaxFrequency;
    }
}
